import React, { useState, useEffect } from "react";
import { BrowserRouter as Router, Route, Link, Routes, useNavigate } from "react-router-dom";

const UserList = () => {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch("https://reqres.in/api/users?page=1");
        const data = await response.json();
        setUsers(data.data);
      } catch (error) {
        console.error("Error fetching data:", error);
      }
    };

    fetchData();
  }, []);

  return (
    <Router>
      <div>
        <h1>Users</h1>
        <ul style={{ listStyleType: "none", padding: 0 }}>
          {users.map((user) => (
            <li key={user.id}>
              <img
                src={user.avatar}
                alt={`${user.first_name} ${user.last_name}`}
              />
              <p>{`${user.first_name} ${user.last_name}`}</p>
            </li>
          ))}
        </ul>
        <div>
          <Link to="/login"><button>Log in</button></Link>
          <Link to="/signin"><button>Sign in</button></Link>
        </div>
        <Routes>
          <Route path="/login">
            <Login />
          </Route>
          <Route path="/signin">
            <SignIn />
          </Route>
        </Routes>
      </div>
    </Router>
  );
};

const Login = () => {
  const navigate = useNavigate();

  const handleSubmit = (e) => {
    e.preventDefault();
    // Logica de autentificare (de exemplu, verificarea datelor introduse)

    // Dacă autentificarea este reușită, se va face redirecționarea
    navigate('/buttons');
  };

  return (
    <div>
      <h2>Login</h2>
      <form onSubmit={handleSubmit}>
        {/* Inputurile pentru datele de autentificare */}
        <input type="text" placeholder="Nume" />
        <input type="text" placeholder="Prenume" />
        <input type="email" placeholder="Email" />
        <input type="password" placeholder="Parola" />
        <button type="submit">Submit</button>
      </form>
    </div>
  );
};


const SignIn = () => {
  // Component pentru procesul de înregistrare (Sign in)
  return (
    <div>
      <h2>Sign in</h2>
      {/* Formular pentru înregistrare */}
    </div>
  );
};

const ButtonsPage = () => {
  // Pagina cu cele 4 butoane
  return (
    <div>
      <h2>Butoane</h2>
      <div style={{ display: "flex" }}>
        <button>1</button>
        <button>2</button>
        <button>3</button>
        <button>4</button>
      </div>
    </div>
  );
};

export default Login;
